    <script src="http://libs.baidu.com/jquery/1.8.3/jquery.min.js"></script>
    <script>
        $('#svg').on('mouseover', 'path', function (e) {
            var key = $(this).attr('id').replace('map-item', '');
            var $node = $('#map-name'+key);
            $(this).attr('fill', '#3285d5').siblings('path').attr('fill', '#133670');
            changeInfo($node);
        });
        $('#svg').on('mousemove', 'path', function (e) {
            showInfo(e);
        });
        $('#svg').on('mouseleave', 'path', function (e) {
            hideInfo(e);
        });
        var showInfo = function(e) {
            var $info = $('.info-wrap');
            var distance = 30;
            var infoH = $info.outerHeight();
            var windowH = $(window).height();
            if (windowH - e.clientY - distance > infoH) {
                $info.css({
                    'left': e.clientX + distance,
                    'top': e.clientY + distance,
                    'bottom': 'auto',
                    'display': 'block'
                });
            } else {
                $info.css({
                    'left': e.clientX + distance,
                    'top': 'auto',
                    'bottom': windowH - e.clientY + distance,
                    'display': 'block'
                });
            }
        }
        var hideInfo = function() {
            $('.info-wrap').hide();
        }
        var changeInfo = function($node) {
            var $info = $('.info-wrap');
            var data = $node.attr('count');
            // var data = Math.floor((Math.random() * (1000 - 500 + 1) + 500));
            $info.find('.title').text($node.text());
            $info.find('span').text(data);
        }
    </script>
